import './App.css';
import { useState } from "react";

export default function SweepNotes() {
  // LP Floors - Study Room and Kitchen
  const [LpFloor1StudyRoom, setLpFloor1StudyRoom] = useState('');
  const [LpFloor1Kitchen, setLpFloor1Kitchen] = useState('');
  const [LpFloor2StudyRoom, setLpFloor2StudyRoom] = useState('');
  const [LpFloor2Kitchen, setLpFloor2Kitchen] = useState('');
  const [LpFloor3StudyRoom, setLpFloor3StudyRoom] = useState('');
  const [LpFloor3Kitchen, setLpFloor3Kitchen] = useState('');
  const [LpFloor4StudyRoom, setLpFloor4StudyRoom] = useState('');
  const [LpFloor4Kitchen, setLpFloor4Kitchen] = useState('');
  const [LpFloor5StudyRoom, setLpFloor5StudyRoom] = useState('');
  const [LpFloor5Kitchen, setLpFloor5Kitchen] = useState('');
  const [LpFloor6StudyRoom, setLpFloor6StudyRoom] = useState('');
  const [LpFloor6Kitchen, setLpFloor6Kitchen] = useState('');

  const [LpCommonRoom, setLpCommonRoom] = useState('');
  const [LpLaundry, setLpLaundry] = useState('');

  // WS Floors
  const [Wsfloor1, setWsfloor1] = useState('');
  const [Wsfloor2, setWsfloor2] = useState('');
  const [Wsfloor3, setWsfloor3] = useState('');
  const [Wsfloor4, setWsfloor4] = useState('');
  const [Wsfloor5, setWsfloor5] = useState('');
  const [Wsfloor6, setWsfloor6] = useState('');
  const [WsStudyRoom, setWsStudyRoom] = useState('');
  const [WsLaundry, setWsLaundry] = useState('');

  const [LpNotes, setLpNotes] = useState('');
  const [WsNotes, setWsNotes] = useState('');

  const handleCopy = () => {
    const sweepNotes = `
      ${LpFloor1StudyRoom && `LP Floor 1: (Students in study room: ${LpFloor1StudyRoom}, Students in kitchen: ${LpFloor1Kitchen})\n`}
      ${LpFloor2StudyRoom && `LP Floor 2: (Students in study room: ${LpFloor2StudyRoom}, Students in kitchen: ${LpFloor2Kitchen})\n`}
      ${LpFloor3StudyRoom && `LP Floor 3: (Students in study room: ${LpFloor3StudyRoom}, Students in kitchen: ${LpFloor3Kitchen})\n`}
      ${LpFloor4StudyRoom && `LP Floor 4: (Students in study room: ${LpFloor4StudyRoom}, Students in kitchen: ${LpFloor4Kitchen})\n`}
      ${LpFloor5StudyRoom && `LP Floor 5: (Students in study room: ${LpFloor5StudyRoom}, Students in kitchen: ${LpFloor5Kitchen})\n`}
      ${LpFloor6StudyRoom && `LP Floor 6: (Students in study room: ${LpFloor6StudyRoom}, Students in kitchen: ${LpFloor6Kitchen})\n`}
      ${LpCommonRoom && `LP Common Spaces: ${LpCommonRoom} students in Common Room, ${LpLaundry} students in Laundry\n`}
      ${LpNotes && `LP Additional Notes: ${LpNotes}\n`}
      ${Wsfloor1 && `WS Floor 1: Students in common room: ${Wsfloor1}\n`}
      ${Wsfloor2 && `WS Floor 2: Students in common room: ${Wsfloor2}\n`}
      ${Wsfloor3 && `WS Floor 3: Students in common room: ${Wsfloor3}\n`}
      ${Wsfloor4 && `WS Floor 4: Students in common room: ${Wsfloor4}\n`}
      ${Wsfloor5 && `WS Floor 5: Students in common room: ${Wsfloor5}\n`}
      ${Wsfloor6 && `WS Floor 6: Students in common room: ${Wsfloor6}\n`}
      ${WsStudyRoom && `WS Basement: ${WsStudyRoom} students in Study Room, ${WsLaundry} students in Laundry\n`}
      ${WsNotes && `WS Additional Notes: ${WsNotes}\n`}
    `;
    navigator.clipboard.writeText(sweepNotes.trim()).then(() => {
      alert("Sweep notes copied to clipboard!");
    });
  };

  return (
    <div className="sweep-notes">
      <div className="input-cards">
        <div className="card">
          <h1>Les Prince</h1>

          <div className="floor">
            <h2>Floor 1</h2>
            <label>Study Room</label>
            <input 
              type="number" 
              value={LpFloor1StudyRoom} 
              onChange={(e) => setLpFloor1StudyRoom(e.target.value)} 
              placeholder="Number of Students" 
            />
            <label>Kitchen</label>
            <input 
              type="number" 
              value={LpFloor1Kitchen} 
              onChange={(e) => setLpFloor1Kitchen(e.target.value)} 
              placeholder="Number of Students" 
            />
          </div>

          <div className="floor">
            <h2>Floor 2</h2>
            <label>Study Room</label>
            <input 
              type="number" 
              value={LpFloor2StudyRoom} 
              onChange={(e) => setLpFloor2StudyRoom(e.target.value)} 
              placeholder="Number of Students" 
            />
            <label>Kitchen</label>
            <input 
              type="number" 
              value={LpFloor2Kitchen} 
              onChange={(e) => setLpFloor2Kitchen(e.target.value)} 
              placeholder="Number of Students" 
            />
          </div>

          <div className="floor">
            <h2>Floor 3</h2>
            <label>Study Room</label>
            <input 
              type="number" 
              value={LpFloor3StudyRoom} 
              onChange={(e) => setLpFloor3StudyRoom(e.target.value)} 
              placeholder="Number of Students" 
            />
            <label>Kitchen</label>
            <input 
              type="number" 
              value={LpFloor3Kitchen} 
              onChange={(e) => setLpFloor3Kitchen(e.target.value)} 
              placeholder="Number of Students" 
            />
          </div>

          <div className="floor">
            <h2>Floor 4</h2>
            <label>Study Room</label>
            <input 
              type="number" 
              value={LpFloor4StudyRoom} 
              onChange={(e) => setLpFloor4StudyRoom(e.target.value)} 
              placeholder="Number of Students" 
            />
            <label>Kitchen</label>
            <input 
              type="number" 
              value={LpFloor4Kitchen} 
              onChange={(e) => setLpFloor4Kitchen(e.target.value)} 
              placeholder="Number of Students" 
            />
          </div>

          <div className="floor">
            <h2>Floor 5</h2>
            <label>Study Room</label>
            <input 
              type="number" 
              value={LpFloor5StudyRoom} 
              onChange={(e) => setLpFloor5StudyRoom(e.target.value)} 
              placeholder="Number of Students" 
            />
            <label>Kitchen</label>
            <input 
              type="number" 
              value={LpFloor5Kitchen} 
              onChange={(e) => setLpFloor5Kitchen(e.target.value)} 
              placeholder="Number of Students" 
            />
          </div>

          <div className="floor">
            <h2>Floor 6</h2>
            <label>Study Room</label>
            <input 
              type="number" 
              value={LpFloor6StudyRoom} 
              onChange={(e) => setLpFloor6StudyRoom(e.target.value)} 
              placeholder="Number of Students" 
            />
            <label>Kitchen</label>
            <input 
              type="number" 
              value={LpFloor6Kitchen} 
              onChange={(e) => setLpFloor6Kitchen(e.target.value)} 
              placeholder="Number of Students" 
            />
          </div>

          <div className="common">
            <h2>Common Spaces</h2>
            <label>Common Room</label>
            <input 
              type="number" 
              value={LpCommonRoom} 
              onChange={(e) => setLpCommonRoom(e.target.value)} 
              placeholder="Number of Students" 
            />
            <label>Laundry</label>
            <input 
              type="number" 
              value={LpLaundry} 
              onChange={(e) => setLpLaundry(e.target.value)} 
              placeholder="Number of Students" 
            />
          </div>

          <div className="notes">
            <label>Additional Notes</label>
            <textarea 
              value={LpNotes} 
              onChange={(e) => setLpNotes(e.target.value)} 
              placeholder="Details about Noise Complaints, Incident Reports, Service Requests, etc." 
            />
          </div>
        </div>

        <div className="card">
          <h1>West Side</h1>

          <div className="floor">
            <h2>Floor 1</h2>
            <label>Common Room</label>
            <input 
              type="number" 
              value={Wsfloor1} 
              onChange={(e) => setWsfloor1(e.target.value)} 
              placeholder="Number of Students" 
            />
          </div>

          <div className="floor">
            <h2>Floor 2</h2>
            <label>Common Room</label>
            <input 
              type="number" 
              value={Wsfloor2} 
              onChange={(e) => setWsfloor2(e.target.value)} 
              placeholder="Number of Students" 
            />
          </div>

          <div className="floor">
            <h2>Floor 3</h2>
            <label>Common Room</label>
            <input 
              type="number" 
              value={Wsfloor3} 
              onChange={(e) => setWsfloor3(e.target.value)} 
              placeholder="Number of Students" 
            />
          </div>

          <div className="floor">
            <h2>Floor 4</h2>
            <label>Common Room</label>
            <input 
              type="number" 
              value={Wsfloor4} 
              onChange={(e) => setWsfloor4(e.target.value)} 
              placeholder="Number of Students" 
            />
          </div>

          <div className="floor">
            <h2>Floor 5</h2>
            <label>Common Room</label>
            <input 
              type="number" 
              value={Wsfloor5} 
              onChange={(e) => setWsfloor5(e.target.value)} 
              placeholder="Number of Students" 
            />
          </div>

          <div className="floor">
            <h2>Floor 6</h2>
            <label>Common Room</label>
            <input 
              type="number" 
              value={Wsfloor6} 
              onChange={(e) => setWsfloor6(e.target.value)} 
              placeholder="Number of Students" 
            />
          </div>

          <div className="basement">
            <h2>Basement</h2>
            <label>Study Room</label>
            <input 
              type="number" 
              value={WsStudyRoom} 
              onChange={(e) => setWsStudyRoom(e.target.value)} 
              placeholder="Number of Students" 
            />
            <label>Laundry</label>
            <input 
              type="number" 
              value={WsLaundry} 
              onChange={(e) => setWsLaundry(e.target.value)} 
              placeholder="Number of Students" 
            />
          </div>

          <div className="notes">
            <label>Additional Notes</label>
            <textarea 
              value={WsNotes} 
              onChange={(e) => setWsNotes(e.target.value)} 
              placeholder="Details about Noise Complaints, Incident Reports, Service Requests, etc." 
            />
          </div>
        </div>
      </div>

      <div className="output-card">
        <button className="copy-button" onClick={handleCopy}>Copy Sweep Notes</button>
        <h1>Sweep Notes</h1>
        <p>Notes will generate once data entered</p>
        {LpFloor1StudyRoom && <p>LP Floor 1: (Students in study room: {LpFloor1StudyRoom}, Students in kitchen: {LpFloor1Kitchen})</p>}
        {LpFloor2StudyRoom && <p>LP Floor 2: (Students in study room: {LpFloor2StudyRoom}, Students in kitchen: {LpFloor2Kitchen})</p>}
        {LpFloor3StudyRoom && <p>LP Floor 3: (Students in study room: {LpFloor3StudyRoom}, Students in kitchen: {LpFloor3Kitchen})</p>}
        {LpFloor4StudyRoom && <p>LP Floor 4: (Students in study room: {LpFloor4StudyRoom}, Students in kitchen: {LpFloor4Kitchen})</p>}
        {LpFloor5StudyRoom && <p>LP Floor 5: (Students in study room: {LpFloor5StudyRoom}, Students in kitchen: {LpFloor5Kitchen})</p>}
        {LpFloor6StudyRoom && <p>LP Floor 6: (Students in study room: {LpFloor6StudyRoom}, Students in kitchen: {LpFloor6Kitchen})</p>}
        {LpCommonRoom && <p>LP Common Spaces: {LpCommonRoom} students in Common Room, {LpLaundry} students in Laundry</p>}
        {LpNotes && <p>LP Additional Notes: {LpNotes}</p>}
        {Wsfloor1 && <p>WS Floor 1: Students in common room: {Wsfloor1}</p>}
        {Wsfloor2 && <p>WS Floor 2: Students in common room: {Wsfloor2}</p>}
        {Wsfloor3 && <p>WS Floor 3: Students in common room: {Wsfloor3}</p>}
        {Wsfloor4 && <p>WS Floor 4: Students in common room: {Wsfloor4}</p>}
        {Wsfloor5 && <p>WS Floor 5: Students in common room: {Wsfloor5}</p>}
        {Wsfloor6 && <p>WS Floor 6: Students in common room: {Wsfloor6}</p>}
        {WsStudyRoom && <p>WS Basement: {WsStudyRoom} students in Study Room, {WsLaundry} students in Laundry</p>}
        {WsNotes && <p>WS Additional Notes: {WsNotes}</p>}
      </div>
    </div>
  );
}
